import React, { useState, useEffect } from "react";
import './DropdownElement.css';
import { GetDiameters, GetPitch, GetNutType } from './GetValues.js'


export function DropdownElement(props) {
    const [lengths, setLengths] = useState(GetLengths());
    const dummyLengths = [0,1,2,3];

    const fetchLengths = () => {
      fetch('/api/v1/bolt-configuration/length')
        .then(response => {
          return response.json()
        })
        .then(lengths => {
          setLengths(lengths)
        })
    }

    useEffect(() => {
        fetchLengths()
      }, [])

    return (
      <div className='dropdown-container'>
        <h5> {props.label} </h5>
          <select>
            {lengths.map(length => (
              <option> {length} </option>
            ))};
          </select>
      </div>
    );
}
